INSERT INTO `bargain_goods` (`id`, `goods_name`, `img1_id`, `img2_id`, `activity_money`, `original_price`, `bargain_section`, `bargain_section2`, `join_count`, `goods_desc`, `goods_desc_m`, `attr1_id`, `attr2_id`, `type`)
VALUES
	(1,'隐适美隐形矫正','/static/bargain/images/sm_03.jpg','/static/bargain/images/big_02.jpg',33800.00,39800.00,'','',0,'<ul><li><span style=\"font-size: 0.36rem\">Invisalign</span>隐适美系统是一种近乎隐形的创新型治疗方法,</li><li>可以轻柔而持久地矫正你的牙齿。 </li><li>既能满足矫正牙齿的需要,</li><li>又同时避免了传统托槽矫正能看到<em style=\"font-size: 0.36rem;font-style:normal;color: red;\">“钢牙”</em>的缺点。</li><li>只需佩戴一副透明的牙套，</li><li>就能让牙齿有效、精准的移动。</li></ul>','',0,0,0),
	(2,'进口金属自锁托槽矫正','/static/bargain/images/sm_05.jpg','/static/bargain/images/big_01.jpg',11800.00,13800.00,'','',0,'<p style=\"text-indent: 2em;\">自锁正畸托槽是指在正畸治疗中，用一种专用的黏结剂固定在牙齿表面的一种金属或陶瓷等材料制成的装置，用于容纳和固定正畸钢丝，传递矫治力到牙齿，从而达到牙齿矫正的目的。</p>','',0,0,0);
